#include <iostream>
using namespace std;

int main()
{
    int t = 0;
    cin >> t;
    while (t--)
    {
        long long n, m, k;
        cin >> n >> m >> k;
        long long s1 = 0, s2 = 0, e1 = 0, e2 = 0;
        for (long long i = 0; i < k; i++)
        {
            long long a;
            cin >> a;
            if (a >= 2 * n) {
                if (s1 + 2 <= n) s1 += 2;
                e1 += a / n - 2;
            }
            if (a >= 2 * m) {
                if (s2 + 2 <= m) s2 += 2;
                e2 += a / m - 2;
            }
        }
        if (s1 + e1 >= m || s2 + e2 >= n)
            cout << "Yes" << endl;
        else
            cout << "No" << endl;
    }
    return 0;
} The missing code is the condition in the first if statement.
